import Apps from './Apps'

function AppBox() {

  return (
    <Grid container spacing={2} justifyContent="center" display="flex" sx={{ pt: 2 }}>
      <Apps containerName="test123" title='Plex' image="https://pap-mediaroom.pl/sites/default/files/styles/open_article_750/public/2022-04/Plex_Logo.jpg"/>
      <Apps containerName="test" title='uTorrent' image="data:image/png;base64," />
      <Apps containerName="nope" title='Nope' image="data:image/png;base64," />
    </Grid>
  )
}

export default AppBox;
